import React from "react";
import  {Link} from "react-router-dom" 
const Movies = ({ props }) => {

  return (
    <div className="container">
      <div>
        {props.map((movies, i) => {
          return (
            <ul key={i}>

              <li>
              <span>hola</span>
                <Link
                  to={`/movies/${movies.imdbID}`}
                >
                  {" "}
                  <img src={movies.Poster} alt={movies.Title} />
                </Link>
              </li>
            </ul>
          );
        })}
      </div>
    </div>
  );
};

export default Movies;
